/**
 * AWS external account client. This is used for AWS workloads, where AWS STS GetCallerIdentity serialized signed requests are exchanged for GCP access token.
 */

/**
 * Triggered when an external subject token is needed to be exchanged for a GCP access token via GCP STS endpoint. This uses the `options.credential_source` object to figure out how to retrieve the token using the current environment. In this case, this uses a serialized AWS signed request to the STS GetCallerIdentity endpoint. The logic is summarized as: 1. Retrieve AWS region from availability-zone. 2a. Check AWS credentials in environment variables. If not found, get from security-credentials endpoint. 2b. Get AWS credentials from security-credentials endpoint. In order to retrieve this, the AWS role needs to be determined by calling security-credentials endpoint without any argument. Then the credentials can be retrieved via: security-credentials/role_name 3. Generate the signed request to AWS STS GetCallerIdentity action. 4. Inject x-goog-cloud-target-resource into header and serialize the signed request. This will be the subject-token to pass to GCP STS.  @return A promise that resolves with the external subject token.
 */

/**
 * AWS credentials JSON interface. This is used for AWS workloads.
 */

